import React from 'react';
import { Link, Routes, Route } from 'react-router-dom';
import UserProfile from './UserProfile';
import defaultImage from './default.jpeg';
import '../App.css';

const btnClk = () => {
  console.log("Button clicked!");
};

const ProfilesPage = () => {
  const renderProfileItems = () => {
    const profileItems = [];

    for (let i = 1; i <= 15; i++) {
      profileItems.push(
        <div key={i} className="portfolio-item">
          <Link to={`/userprofile`} onClick={btnClk}>
            <a className='buttonProfile'>
              <img src={defaultImage} alt={`Profile ${i}`} />
              <span className='username'>Username {i}</span>
            </a>
          </Link>
        </div>
      );
    }

    return profileItems;
  };

  return (
    <div>
      <div className="container">
        <div className="portfolio-grid">{renderProfileItems()}</div>
      </div>
      <Routes>
        <Route path="/userprofile/" element={<UserProfile />} />
      </Routes>
    </div>
  );
};

export default ProfilesPage;
